import React, { useState } from 'react';
import { Box, Typography, TextField, Grid } from "@mui/material";
import { styled } from '@mui/system';
import { useFormik } from 'formik';
import { Link } from '@mui/material';
import { GoogleMap, LoadScript } from '@react-google-maps/api';


const Profile = () => {
  // const dispatch = useDispatch();
  // const navigate = useNavigate();
  // const [loading, setLoading] = useState(false);
  // const users = useSelector((state) => state.getuser?.getusers);

  const [name, setname] = useState("");
  const [username, setusername] = useState("");
  const [email, setEmail] = useState("");
  const [interest, setInterest] = useState("");
  const [location, setLocation] = useState("");
  const [billingInfo, setBillingInfo] = useState("");
  const StyledTypography = styled(Typography)({
    textTransform: 'uppercase',
    textAlign: 'center',
    marginBottom: 5,
  });

  const StyledButton = styled(Button)({
    width: '100%',
    marginTop: '1rem',
  });


  const {
    values,
    errors,
    touched,
    handleChange,
    handleSubmit,
    handleBlur,
  } = useFormik({
    initialValues: {
      name: '',
      username: '',
      email: '',
      interest: '',
      location: '',
      billingInfo: '',
    },
    // validationSchema: crudopeUser,
    onSubmit: async (values) => {
  //     const [username, setusername] = useState("");
  // const [email, setEmail] = useState("");
  // const [password, setpassword] = useState("");
  // const [rePassword, setrePassword] = useState("");
  // const dispatch = useDispatch();
  //     e.preventDefault();
  //     if (password !== rePassword) {
  //       toast.error("Password does not match");
  //     } else {
  //       signup(dispatch, { username, email, password });
  //       setusername("");
  //       setEmail("");
  //       setpassword("");
  //       setrePassword("");
  //       redirect("/signup")
  //     }
    },
  });

  return (
    <Box
      sx={{
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
        minHeight: '100vh',
        backgroundImage: "linear-gradient(to right, rgba(132, 250, 176, 0.5), rgba(143, 211, 244, 0.5))",
      }}
    >
      <Box sx={{ width: '100%', maxWidth: 550, backgroundColor: 'white', padding: '2rem', margin: ".5rem", borderRadius: '15px' }}>

        <StyledTypography variant="h4">Profile</StyledTypography>
        <form onSubmit={"handleSubmit"}>
          <TextField
            sx={{ mt: 1, mb: 1 }}
            fullWidth
            label="Name"
            variant="outlined"
            margin="normal"
            value={values.name}
            onChange={handleChange}
            onBlur={handleBlur}
            error={errors.name && touched.name}
            helperText={errors.name && touched.name && errors.name}
            id="name"
            name="name"
          />
          <TextField
            sx={{ mt: 1, mb: 1 }}
            fullWidth
            label="UserName"
            variant="outlined"
            margin="normal"
            value={values.name}
            onChange={handleChange}
            onBlur={handleBlur}
            error={errors.name && touched.name}
            helperText={errors.name && touched.name && errors.name}
            id="username"
            name="username"
          />
          <TextField
            sx={{ mt: 1, mb: 1 }}
            fullWidth
            label="Email"
            variant="outlined"
            margin="normal"
            value={values.email}
            onChange={handleChange}
            onBlur={handleBlur}
            error={errors.email && touched.email}
            helperText={errors.email && touched.email && errors.email}
            id="email"
            name="email"
          />
          <TextField
            sx={{ mt: 1, mb: 1 }}
            fullWidth
            label="Interests"
            variant="outlined"
            margin="normal"
            value={values.contact}
            onChange={handleChange}
            onBlur={handleBlur}
            error={errors.contact && touched.contact}
            helperText={errors.contact && touched.contact && errors.contact}
            id="interests"
            name="interests"
          />
          <TextField
            sx={{ mt: 1, mb: 1 }}
            fullWidth
            label="Location"
            variant="outlined"
            margin="normal"
            value={values.password}
            onChange={handleChange}
            onBlur={handleBlur}
            error={errors.password && touched.password}
            helperText={errors.password && touched.password && errors.password}
            id="location"
            name="location"
          />
          <TextField
            sx={{ mt: 1, mb: 1 }}
            fullWidth
            label="Billing Info"
            variant="outlined"
            margin="normal"
            value={values.contactNumber}
            onChange={handleChange}
            onBlur={handleBlur}
            error={errors.contactNumber && touched.contactNumber}
            helperText={errors.contactNumber && touched.contactNumber && errors.contactNumber}
            id="billingInfo"
            name="billingInfo"
          />

        </form>
      </Box>
    </Box>
  );
};

export default Profile;
